import React from 'react';
import BookList from './components/BookList';  // Correct import if default export
import SearchBooks from './components/SearchBooks';  // Correct import if default export
import RecommendedBook from './components/RecommendedBook';  // Correct import if default export
import ReviewForm from './components/ReviewForm';  // Correct import if default export

const App = () => {
  return (
    <div>
      <BookList />
      <SearchBooks />
      <RecommendedBook />
      <ReviewForm />
    </div>
  );
}

export default App;
